import React, { useContext } from 'react';
import './Cube.scss';
import { GlobalContext } from 'context/GlobalContext';
import CubeSide1 from 'components/Cube/CubeSide1';

const Cube = () => {
  const { xVal, yVal, zVal } = useContext(GlobalContext);

  return <CubeSide1 xVal={xVal} yVal={yVal} zVal={zVal} />;
};

export default Cube;
